import { useState } from "react";

export const useSelectIndex = () => {
    const [zIndex, setZIndex] = useState(50);

    const getZIndex = () => {
        const idx = zIndex;
        setZIndex(zIndex - 1);
        return idx;
    };

    return getZIndex;
};
